import React, { Component } from 'react'
import WorkSub from "./WorkSub";



const Works = () => (
   <div className="container">
       <div className="row">
           <div className="col"><WorkSub></WorkSub></div>
           <div className="col"><WorkSub></WorkSub></div>
            <div className="col"><WorkSub></WorkSub></div>
       </div>
   </div>
  );
  export default Works;
